    constructor(props){
        super(props)
        this.state = {
            zip: ''
        }
    }

    zipChange = (event) => {
        this.setState({
            zip: event.target.value
        })
    }

    render(){
        return(
            <div>
              Search Page
              <form onSubmit={e =>{
                console.log(this.state.zip)
